import {Route,Routes} from "react-router"

import logo from './logo.svg';
import './App.css';
import SignUp from './components/SignUp';
import Principal from './components/Principal';

function App() {
  return (
  <>
    <Principal />
    <Routes>
      <Route
      path="/"
      exact 
      element={
        <>
          <Principal></Principal>
        </>
      }>

      </Route>
      <Route
       path="/divisas"
       exact 
       element={
         <>
           <h1>React</h1>
         </>
       }>

      </Route>
    </Routes>
  </>

  );
}

export default App;
